#!/bin/bash

#==============================================================================
# Script d'installation de la configuration GNOME personnalis√©e
# Pour Ubuntu Desktop avec GNOME
# Version 2.2.0 - Menu interactif, activation extensions, backup/restore
#==============================================================================

VERSION="2.2.0"

# D√©terminer le chemin absolu du script IMM√âDIATEMENT (avant tout cd)
# Ceci doit √™tre fait en premier pour √©viter les probl√®mes de chemin
if [ -n "${BASH_SOURCE[0]}" ]; then
    SCRIPT_REAL_PATH="$(cd "$(dirname "${BASH_SOURCE[0]}")" && pwd)/$(basename "${BASH_SOURCE[0]}")"
else
    SCRIPT_REAL_PATH="$(cd "$(dirname "$0")" && pwd)/$(basename "$0")"
fi

# Couleurs pour les messages
RED='\033[0;31m'
GREEN='\033[0;32m'
YELLOW='\033[1;33m'
BLUE='\033[0;34m'
MAGENTA='\033[0;35m'
CYAN='\033[0;36m'
NC='\033[0m' # No Color

# Compteurs d'erreurs
ERRORS=0
WARNINGS=0

# Options du script
DRY_RUN=false
VERBOSE=false
INTERACTIVE=true
SKIP_UPGRADE=false
LOG_FILE="$HOME/gnome-install-$(date +%Y%m%d-%H%M%S).log"
ACTION="" # install, remove, backup, restore

# Fonction pour afficher l'aide
show_help() {
    cat << EOF
‚ïî‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïó
‚ïë  Enhanced Ubuntu Desktop Experience - Installeur v${VERSION}           ‚ïë
‚ïö‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïù

Usage: $0 [OPTIONS]

OPTIONS:
    -h, --help              Afficher cette aide
    -v, --verbose           Mode verbeux (afficher plus de d√©tails)
    -y, --non-interactive   Mode non-interactif (pas de questions)
    -d, --dry-run           Simuler l'installation sans rien modifier
    --skip-upgrade          Sauter la mise √† niveau du syst√®me (apt upgrade)
    --log FILE              Chemin personnalis√© pour le fichier de log
                            (d√©faut: ~/gnome-install-YYYYMMDD-HHMMSS.log)
    --install               Installer directement (sans menu)
    --remove                Restaurer les th√®mes par d√©faut
    --backup                Cr√©er uniquement un backup
    --restore               Restaurer depuis un backup

EXEMPLES:
    $0                      Menu interactif
    $0 --install            Installation directe
    $0 --remove             D√©sinstaller et restaurer d√©fauts Ubuntu
    $0 --backup             Cr√©er un backup seulement
    $0 -y --install         Installation automatique
    $0 -d                   Simuler l'installation
    $0 -v --skip-upgrade    Mode verbeux sans mise √† niveau syst√®me
    $0 -y --log /tmp/install.log  Installation auto avec log personnalis√©

DESCRIPTION:
    Ce script installe une configuration GNOME personnalis√©e avec:
    - Polices: Comfortaa, JetBrains Mono
    - Th√®me: Lavanda-Sea
    - Ic√¥nes: Uos-fulldistro-icons
    - Curseurs: Bibata-Modern-Ice
    - 12 extensions GNOME

Le script cr√©e automatiquement un fichier de log dans votre dossier personnel.

EOF
    exit 0
}

# Parse des arguments
while [[ $# -gt 0 ]]; do
    case $1 in
        -h|--help)
            show_help
            ;;
        -v|--verbose)
            VERBOSE=true
            shift
            ;;
        -y|--non-interactive)
            INTERACTIVE=false
            shift
            ;;
        -d|--dry-run)
            DRY_RUN=true
            INTERACTIVE=false
            shift
            ;;
        --skip-upgrade)
            SKIP_UPGRADE=true
            shift
            ;;
        --log)
            LOG_FILE="$2"
            shift 2
            ;;
        --install)
            ACTION="install"
            shift
            ;;
        --remove)
            ACTION="remove"
            shift
            ;;
        --backup)
            ACTION="backup"
            shift
            ;;
        --restore)
            ACTION="restore"
            shift
            ;;
        *)
            echo "Option inconnue: $1"
            echo "Utilisez --help pour voir les options disponibles"
            exit 1
            ;;
    esac
done

# Fonction de logging
log() {
    echo "[$(date '+%Y-%m-%d %H:%M:%S')] $1" >> "$LOG_FILE"
}

# Fonctions d'affichage am√©lior√©es
print_status() {
    echo -e "${BLUE}[INFO]${NC} $1"
    log "INFO: $1"
}

print_success() {
    echo -e "${GREEN}[‚úì]${NC} $1"
    log "SUCCESS: $1"
}

print_error() {
    echo -e "${RED}[‚úó]${NC} $1"
    log "ERROR: $1"
    ((ERRORS++))
}

print_warning() {
    echo -e "${YELLOW}[!]${NC} $1"
    log "WARNING: $1"
    ((WARNINGS++))
}

print_verbose() {
    if [ "$VERBOSE" = true ]; then
        echo -e "${CYAN}[DEBUG]${NC} $1"
        log "DEBUG: $1"
    fi
}

print_dry_run() {
    if [ "$DRY_RUN" = true ]; then
        echo -e "${MAGENTA}[DRY-RUN]${NC} $1"
        log "DRY-RUN: $1"
    fi
}

# Fonction pour v√©rifier si une commande existe
command_exists() {
    command -v "$1" >/dev/null 2>&1
}

# Fonction pour v√©rifier le code de sortie
check_error() {
    if [ $? -ne 0 ]; then
        print_error "$1"
        return 1
    else
        print_success "$2"
        return 0
    fi
}

# Fonction pour demander confirmation
ask_confirmation() {
    if [ "$INTERACTIVE" = false ]; then
        return 0
    fi
    
    local question="$1"
    local default="${2:-y}"
    
    if [ "$default" = "y" ]; then
        read -p "$question [O/n] " -n 1 -r
    else
        read -p "$question [o/N] " -n 1 -r
    fi
    echo
    
    if [[ $REPLY =~ ^[OoYy]$ ]] || [[ -z $REPLY && $default = "y" ]]; then
        return 0
    else
        return 1
    fi
}

# Fonction pour v√©rifier l'espace disque
check_disk_space() {
    local required_mb=500
    local available_mb=$(df -m "$HOME" | awk 'NR==2 {print $4}')
    
    print_verbose "Espace disque disponible: ${available_mb} MB (requis: ${required_mb} MB)"
    
    if [ "$available_mb" -lt "$required_mb" ]; then
        print_error "Espace disque insuffisant! Requis: ${required_mb} MB, Disponible: ${available_mb} MB"
        return 1
    else
        print_success "Espace disque suffisant (${available_mb} MB disponibles)"
        return 0
    fi
}

# Fonction pour cr√©er un point de restauration (backup des param√®tres)
create_backup() {
    if [ "$DRY_RUN" = true ]; then
        print_dry_run "Cr√©ation d'un backup des param√®tres actuels"
        return 0
    fi
    
    local backup_dir="$HOME/.gnome-config-backup-$(date +%Y%m%d-%H%M%S)"
    print_status "Cr√©ation d'un backup des param√®tres actuels dans $backup_dir"
    
    mkdir -p "$backup_dir"
    
    # Backup des param√®tres gsettings
    dconf dump /org/gnome/desktop/ > "$backup_dir/desktop-settings.dconf" 2>/dev/null
    dconf dump /org/gnome/shell/ > "$backup_dir/shell-settings.dconf" 2>/dev/null
    
    # Liste des extensions actuellement activ√©es
    gnome-extensions list --enabled > "$backup_dir/enabled-extensions.txt" 2>/dev/null
    
    print_success "Backup cr√©√©: $backup_dir"
    log "Backup cr√©√© dans: $backup_dir"
    
    echo "$backup_dir" > "$HOME/.gnome-config-last-backup"
}

# Fonction pour restaurer depuis un backup
restore_backup() {
    local backup_dir="$1"
    
    if [ -z "$backup_dir" ] && [ -f "$HOME/.gnome-config-last-backup" ]; then
        backup_dir=$(cat "$HOME/.gnome-config-last-backup")
    fi
    
    if [ -z "$backup_dir" ] || [ ! -d "$backup_dir" ]; then
        print_error "Aucun backup trouv√©"
        return 1
    fi
    
    print_status "Restauration depuis: $backup_dir"
    
    if [ -f "$backup_dir/desktop-settings.dconf" ]; then
        dconf load /org/gnome/desktop/ < "$backup_dir/desktop-settings.dconf"
    fi
    
    if [ -f "$backup_dir/shell-settings.dconf" ]; then
        dconf load /org/gnome/shell/ < "$backup_dir/shell-settings.dconf"
    fi
    
    if [ -f "$backup_dir/enabled-extensions.txt" ]; then
        # D√©sactiver toutes les extensions actuelles
        gnome-extensions list --enabled | while read ext; do
            gnome-extensions disable "$ext" 2>/dev/null
        done
        
        # R√©activer les extensions du backup
        while read ext; do
            gnome-extensions enable "$ext" 2>/dev/null
        done < "$backup_dir/enabled-extensions.txt"
    fi
    
    print_success "Restauration termin√©e"
}

# Fonction pour restaurer les param√®tres par d√©faut Ubuntu
