    print_status "Restauration des param√®tres par d√©faut Ubuntu..."
    
    if [ "$DRY_RUN" = true ]; then
        print_dry_run "Restauration des param√®tres par d√©faut"
        return 0
    fi
    
    # D√©sactiver toutes les extensions personnalis√©es
    print_status "D√©sactivation des extensions personnalis√©es..."
    declare -A EXTENSIONS=(
        ["blur-my-shell@aunetx"]="3193"
        ["burn-my-windows@schneegans.github.com"]="4679"
        ["clipboard-indicator@tudmotu.com"]="779"
