    )
    
    for extension_uuid in "${!EXTENSIONS[@]}"; do
        gnome-extensions disable "$extension_uuid" 2>/dev/null
        print_verbose "$extension_uuid d√©sactiv√©"
    done
    
    # R√©activer les extensions Ubuntu par d√©faut
    print_status "R√©activation des extensions Ubuntu par d√©faut..."
    gnome-extensions enable ubuntu-dock@ubuntu.com 2>/dev/null && print_verbose "ubuntu-dock activ√©"
    gnome-extensions enable tiling-assistant@ubuntu.com 2>/dev/null && print_verbose "tiling-assistant activ√©"
    gnome-extensions enable ubuntu-appindicators@ubuntu.com 2>/dev/null && print_verbose "ubuntu-appindicators activ√©"
    
    # Restaurer les th√®mes par d√©faut
    print_status "Restauration des th√®mes par d√©faut..."
    gsettings reset org.gnome.desktop.interface gtk-theme 2>/dev/null
    gsettings reset org.gnome.desktop.interface icon-theme 2>/dev/null
    gsettings reset org.gnome.desktop.interface cursor-theme 2>/dev/null
