    gsettings reset org.gnome.desktop.background picture-options 2>/dev/null
    
    print_success "Param√®tres par d√©faut Ubuntu restaur√©s"
    
    # Demander si l'utilisateur souhaite supprimer les fichiers install√©s
    if [ "$INTERACTIVE" = true ]; then
        echo ""
        echo -e "${YELLOW}‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê${NC}"
        echo -e "${YELLOW}‚ö†Ô∏è  Souhaitez-vous √©galement supprimer tous les fichiers install√©s ?${NC}"
        echo -e "${YELLOW}‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê${NC}"
        echo ""
        echo "Cela supprimera :"
        echo "  ‚Ä¢ Th√®mes dans ~/.themes/ (Lavanda-*)"
        echo "  ‚Ä¢ Ic√¥nes dans ~/.icons/ (Uos-*, Bibata-*)"
        echo "  ‚Ä¢ Curseurs dans ~/.icons/ (Bibata-*)"
        echo "  ‚Ä¢ Polices dans ~/.local/share/fonts/ (Comfortaa, Poppins)"
        echo "  ‚Ä¢ Extensions GNOME t√©l√©charg√©es"
        echo "  ‚Ä¢ Fond d'√©cran personnalis√©"
        echo ""
        echo -e "${CYAN}Note: Les packages syst√®me install√©s (via apt) seront conserv√©s${NC}"
        echo ""
        
        read -p "Supprimer tous les fichiers install√©s ? [o/N] " -n 1 -r
        echo ""
        
        if [[ $REPLY =~ ^[OoYy]$ ]]; then
            print_status "Suppression des fichiers install√©s..."
            
            # Supprimer les th√®mes
            if [ -d "$HOME/.themes" ]; then
                rm -rf "$HOME/.themes/Lavanda"* 2>/dev/null && print_verbose "Th√®mes Lavanda supprim√©s"
            fi
            
            # Supprimer les ic√¥nes et curseurs
            if [ -d "$HOME/.icons" ]; then
                rm -rf "$HOME/.icons/Uos"* 2>/dev/null && print_verbose "Ic√¥nes Uos supprim√©es"
                rm -rf "$HOME/.icons/Bibata"* 2>/dev/null && print_verbose "Curseurs Bibata supprim√©s"
            fi
            
            # Supprimer les polices
            if [ -d "$HOME/.local/share/fonts" ]; then
                rm -rf "$HOME/.local/share/fonts/Comfortaa" 2>/dev/null && print_verbose "Police Comfortaa supprim√©e"
                rm -rf "$HOME/.local/share/fonts/Poppins" 2>/dev/null && print_verbose "Police Poppins supprim√©e"
                # Mettre √† jour le cache des polices
                fc-cache -f -v >/dev/null 2>&1 && print_verbose "Cache des polices mis √† jour"
            fi
            
            # Supprimer les extensions GNOME
            if [ -d "$HOME/.local/share/gnome-shell/extensions" ]; then
                for extension_uuid in "${!EXTENSIONS[@]}"; do
                    rm -rf "$HOME/.local/share/gnome-shell/extensions/$extension_uuid" 2>/dev/null
                done
                print_verbose "Extensions GNOME supprim√©es"
            fi
            
            # Supprimer le fond d'√©cran personnalis√©
            if [ -f "$HOME/.local/share/backgrounds/enhanced-ubuntu-wallpaper.png" ]; then
                rm -f "$HOME/.local/share/backgrounds/enhanced-ubuntu-wallpaper.png" 2>/dev/null
