            fi
            
            print_success "Tous les fichiers personnalis√©s ont √©t√© supprim√©s"
            echo ""
            echo -e "${CYAN}üí° Pour supprimer √©galement les packages syst√®me install√©s, ex√©cutez :${NC}"
