        else
            echo ""
            print_status "Les fichiers personnalis√©s restent install√©s dans:"
            echo "  ‚Ä¢ ~/.themes/"
            echo "  ‚Ä¢ ~/.icons/"
            echo "  ‚Ä¢ ~/.local/share/fonts/"
