            echo -e "${CYAN}   rm -f ~/.local/share/backgrounds/enhanced-ubuntu-wallpaper.png${NC}"
        fi
    else
        print_status "Les fichiers personnalis√©s restent install√©s (mode non-interactif)"
        print_status "Pour les supprimer: rm -rf ~/.themes/Lavanda* ~/.icons/Uos* ~/.icons/Bibata*"
    fi
}

