install_gnome_extension() {
    local extension_uuid="$1"
    local extension_id="$2"
    
    print_status "Installation de l'extension: $extension_uuid"
    print_verbose "Extension ID: $extension_id, GNOME version: $GNOME_VERSION"
    
    if [ "$DRY_RUN" = true ]; then
        print_dry_run "Installation de $extension_uuid (ID: $extension_id)"
        return 0
    fi
    
    local info_url="https://extensions.gnome.org/extension-info/?pk=${extension_id}&shell_version=${GNOME_VERSION}"
    print_verbose "info_url: $info_url"
    local info_json=$(curl -s --max-time 10 "$info_url")
    
    # Extraction de download_url avec python (plus robuste que grep/sed)
    local download_url=$(echo "$info_json" | python3 -c "import sys, json; data=json.load(sys.stdin); print(data.get('download_url', ''))" 2>/dev/null)
    
    # Fallback si python √©choue : utilisation de grep/sed
    if [ -z "$download_url" ]; then
        download_url=$(echo "$info_json" | grep -oP '"download_url"\s*:\s*"\K[^"]+')
    fi

    if [ -z "$download_url" ]; then
        print_warning "Impossible de trouver l'URL de t√©l√©chargement pour $extension_uuid (peut-√™tre incompatible avec GNOME $GNOME_VERSION)"
        print_verbose "Contenu JSON retourn√© par l'API : $info_json"
        return 1
    fi

    print_verbose "URL de t√©l√©chargement: https://extensions.gnome.org${download_url}"

    local extension_file="${extension_uuid}.zip"
    if wget -q --timeout=30 "https://extensions.gnome.org${download_url}" -O "$extension_file" 2>/dev/null; then
        local extension_dir="$HOME/.local/share/gnome-shell/extensions/${extension_uuid}"
        mkdir -p "$extension_dir"

        if unzip -o -q "$extension_file" -d "$extension_dir" 2>/dev/null; then
            # V√©rifier que metadata.json existe (extension valide)
            if [ ! -f "$extension_dir/metadata.json" ]; then
                print_warning "Extension $extension_uuid invalide (metadata.json manquant)"
                rm -rf "$extension_dir"
                rm -f "$extension_file"
                return 1
            fi
            
            if [ -d "$extension_dir/schemas" ]; then
                if glib-compile-schemas "$extension_dir/schemas/" 2>/dev/null; then
                    print_verbose "Sch√©mas compil√©s pour $extension_uuid"
                else
                    print_warning "√âchec de compilation des sch√©mas pour $extension_uuid"
                    rm -rf "$extension_dir"
                    rm -f "$extension_file"
                    return 1
                fi
            fi
            print_success "$extension_uuid install√©"
            rm -f "$extension_file"
            return 0
        else
            print_warning "√âchec de l'extraction de $extension_uuid"
            rm -rf "$extension_dir"
            rm -f "$extension_file"
            return 1
        fi
    else
        print_warning "√âchec du t√©l√©chargement de $extension_uuid"
        rm -f "$extension_file"
        return 1
    fi
}

extension_count=0
extension_success=0
successfully_installed_extensions=()

for extension_uuid in "${!EXTENSIONS[@]}"; do
    ((extension_count++))
    extension_id="${EXTENSIONS[$extension_uuid]}"
    print_verbose "Installation pour GNOME_VERSION=$GNOME_VERSION"
    if install_gnome_extension "$extension_uuid" "$extension_id"; then
