if [ "$extension_success" -eq 0 ]; then
    print_error "Aucune extension GNOME n'a pu √™tre install√©e. V√©rifiez la compatibilit√© des extensions avec GNOME $GNOME_VERSION, la connexion internet, ou consultez le log pour le d√©tail des erreurs."
