print_status "Installation du fond d'√©cran personnalis√©..."

if [ "$DRY_RUN" = false ]; then
    # Cr√©er le dossier pour le fond d'√©cran
    WALLPAPER_DIR="$HOME/.local/share/backgrounds"
    mkdir -p "$WALLPAPER_DIR"
    
    # Nom du fichier de fond d'√©cran
    WALLPAPER_FILE="$WALLPAPER_DIR/enhanced-ubuntu-wallpaper.png"
    
    # Utiliser le chemin du script d√©tect√© au d√©but (avant tout cd)
    SCRIPT_PATH="$SCRIPT_REAL_PATH"
    
    log "Utilisation du chemin du script sauvegard√©: $SCRIPT_PATH"
    
    # V√©rifier que le script existe
    if [ ! -f "$SCRIPT_PATH" ]; then
        print_error "Le script n'existe pas √† l'emplacement sauvegard√©: $SCRIPT_PATH"
        print_error "Ceci ne devrait pas arriver. Le script a peut-√™tre √©t√© supprim√© pendant l'ex√©cution."
        ERRORS=$((ERRORS + 1))
        SCRIPT_PATH=""
    else
        log "‚úì Chemin du script valid√©: $SCRIPT_PATH"
    fi
    
    # Proc√©der √† l'extraction seulement si le script est accessible
    if [ -n "$SCRIPT_PATH" ] && [ -f "$SCRIPT_PATH" ]; then
        log "Extraction du fond d'√©cran depuis: $SCRIPT_PATH"
        
        # V√©rifier que le marqueur __WALLPAPER_DATA__ existe
        if ! grep -q '^__WALLPAPER_DATA__$' "$SCRIPT_PATH" 2>/dev/null; then
            print_error "Marqueur __WALLPAPER_DATA__ non trouv√© dans $SCRIPT_PATH"
            print_error "Le script semble incomplet ou corrompu."
            ERRORS=$((ERRORS + 1))
        else
            # D√©coder le fond d'√©cran depuis base64 (encod√© dans le script)
            # Le fond d'√©cran est inclus √† la fin de ce script apr√®s la ligne __WALLPAPER_DATA__
            sed -n '/^__WALLPAPER_DATA__$/,${p}' "$SCRIPT_PATH" | tail -n +2 | base64 -d > "$WALLPAPER_FILE" 2>/dev/null
            
            # V√©rifier que le fichier a bien √©t√© cr√©√© ET qu'il n'est pas vide
            if [ -f "$WALLPAPER_FILE" ] && [ -s "$WALLPAPER_FILE" ]; then
                file_size=$(stat -c%s "$WALLPAPER_FILE" 2>/dev/null || echo "inconnu")
                log "Fond d'√©cran extrait: $file_size octets"
                
                # D√©finir les permissions correctes
                chmod 644 "$WALLPAPER_FILE" 2>/dev/null
                
                # Appliquer le fond d'√©cran
                gsettings set org.gnome.desktop.background picture-uri "file://$WALLPAPER_FILE" 2>/dev/null
                # Essayer d'appliquer pour le mode sombre (peut ne pas exister sur toutes les versions de GNOME)
                gsettings set org.gnome.desktop.background picture-uri-dark "file://$WALLPAPER_FILE" 2>/dev/null || true
                gsettings set org.gnome.desktop.background picture-options 'zoom' 2>/dev/null
                
                # V√©rifier que les param√®tres ont √©t√© appliqu√©s
                current_wallpaper=$(gsettings get org.gnome.desktop.background picture-uri 2>/dev/null)
                if [ "$current_wallpaper" = "'file://$WALLPAPER_FILE'" ]; then
                    print_success "Fond d'√©cran personnalis√© install√© et appliqu√©: $WALLPAPER_FILE ($file_size octets)"
                else
                    print_warning "Fond d'√©cran cr√©√© ($file_size octets) mais non appliqu√©. Chemin: $WALLPAPER_FILE"
                    log "current_wallpaper=$current_wallpaper, expected='file://$WALLPAPER_FILE'"
                fi
            else
                print_error "Le fichier de fond d'√©cran est vide ou n'a pas pu √™tre cr√©√©!"
                if [ -f "$WALLPAPER_FILE" ]; then
                    file_size=$(stat -c%s "$WALLPAPER_FILE" 2>/dev/null || echo "0")
                    log "D√©tails: file=$WALLPAPER_FILE, size=$file_size octets"
                    rm -f "$WALLPAPER_FILE" 2>/dev/null
                fi
                log "Donn√©es extraites: $(sed -n '/^__WALLPAPER_DATA__$/,${p}' "$SCRIPT_PATH" | tail -n +2 | wc -c 2>/dev/null || echo 0) octets"
                ERRORS=$((ERRORS + 1))
            fi
        fi
    fi
